B.Cl=A.b(s(["This mobile app was meant to go along side Chico State's 'Physics of Music' general education course. The main point of the app was to combine features of pre-existing mobile apps (i.e. Phyphox and Physics Toolbox) into a more cohesive and student friendly way. Some of the features are single-tone generation, power spectrum distribution for signal analysis, and an audio filter to extract the underlying wave from noisy input signals.","This project is explained in a lot more detail if you click this card. Essentially, the LiDAR data acquisition (DAQ) software for the Raman-shifted Eye-safe Aerosol LiDAR (REAL) runs on a single machine that is 20+ years old running LabVIEW code that is maintained remotely. Dr. Shane Mayor wants to move the data acquisition software to a newer machine where the DAQ software is written in Python. The main reason for this is that LabVIEW is not only expensive to keep a license for, but it's also not very new-user friendly. I did as much as I could working on this project with part-time hours in a 3 week period. The program should be in a constant loop waiting for a particular trigger pulse which would start the data acquisition. Once that pulse is received, 6 data acquisition processes should begin at the same time which are then placed into a record, that record is broadcasted on a network socket, and all of that data is written to disk before starting the loop over waiting for another trigger event.","This is my capstone for completing the Computer Science degree at Chico State built using Unity. The user can graphically create a 3-D electric charge configuration to calculate the electric field at a point in space. It also displays a qualitative electric vector field around the charge configuration to help introductory physics students build an intuition for E&M physics. This was my first real project done in Unity and I learned a lot of how to use the engine as well as make something that combined my interests in Physics and Computer Science.","This was my final project for my Software Engineering class that I took at CSU Northridge. We were in groups of 5-7 and my group decided to create a glorified to-do list. This web application is to be a simple, space-themed to-do list primarily for those with ADHD. The web application comprises of users creating a to-do list of their daily tasks which are preserved in Google Firebase for future reference. To my knowledge, the website is hosted on some server at CSU Bakersfield, and I do not know if the Firebase backend is still functional.","The website you're on is my portfolio website made using Flutter. This is where I will be updating past and ongoing projects I have.","Growing up, my friends and I used to play games together but it was always dependent on one specific individual to be online to host the game's server. This project is a discord bot that runs on an 8GB Raspberry Pi 4 which could start and stop the server given the proper commands. I made this using discord.py and the mcrcon python library to control the game through the discord bot. This is sadly a project that I did before I knew how to use Git/Github so it was lost to time, but if I have time I'll rebuild it and use Github to display it here.","This was a project that I built in 2019 while I was in high school for my CAS project as a part of the International Baccalaureate program requirements. It combined the dance pads from two different arcade rhythm games, Dance Dance Revolution (DDR) and Pump It Up (PIU). DDR traditionally has 4 foot panels, up, down, left, and right, whereas PIU traditionally has 5, diagonal up-left, diagonal up-right, diagonal down-left, diagonal down-right, and the centre. This project was to combine both of these into a single dance pad that could be used with the game StepMania5. Even an image of this project was lost to time so I've just put an image of what the two arcade dance pads look like side-by-side. My version was basically a wooden frame made of 2x4s in a '#' pattern in a square box where the panels were a sheet of 1/2 inch MDF with acrylic on top. The electronics were done using custom pull up resistors made of tin foil for the buttons and were wired using cheap wire from Ace Hardware fed into a cheap USB encoder to simulate key presses."]),t.s)
